	private string SafeCSharpName(string name)
	{
		if (string.IsNullOrWhiteSpace(name))
			return "_";

		StringBuilder safe = new StringBuilder();
		if (name.Length == 0 || NeedsUnderscore(name[0]))
			safe.Append("_");

