		{
			if (IsSafeChar(c))
				safe.Append(c);
			else if (c == ' ' || c == '-')
				safe.Append('_');
			else if (c == '+')
				safe.Append("_plus_");
		}

		return safe.ToString().Replace("__", "_");
	}
	private bool NeedsUnderscore(char c)
	{
		return !(('A' <= c && c <= 'Z') || ('a' <= c && c <= 'z') || (c == '_'));
	}
	private bool IsSafeChar(char c)
	{
		return (('0' <= c && c <= '9') || ('A' <= c && c <= 'Z') || ('a' <= c && c <= 'z') || (c == '_'));
	}
